import { Column, Stack, Card, Box, Columns } from 'braid-design-system';
import { Component } from 'react';

export class Game extends Component {
  render() {
    return (
      <Box id='gameBoard'>
        <Stack>
          <Columns>
            <Column>
              <Box
                background='cautionLight'
                boxShadow='borderCaution'
                style={{ width: '20%', paddingBottom: '15%' }}
              >
                0,0
              </Box>
            </Column>
            <Column>
              <Card>1,0</Card>
            </Column>
            <Column>
              <Card>2,0</Card>
            </Column>
            <Column>
              <Card>3,0</Card>
            </Column>
          </Columns>
        </Stack>
      </Box>
    );
  }
}
